selector_to_html = {"a[href=\"#ssh-connections\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">SSH Connections<a class=\"headerlink\" href=\"#ssh-connections\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://learn.microsoft.com/en-us/windows/terminal/tutorials/ssh\"><code class=\"docutils literal notranslate\"><span class=\"pre\">ssh</span></code></a> is a communication protocol that will allow you to access MBO servers from the command line.</p><p>To establish a connection, the computer you are connecting from (the \u2018client\u2019) must have a private ssh key.</p>", "a[href=\"#filesystem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Filesystem<a class=\"headerlink\" href=\"#filesystem\" title=\"Permalink to this heading\">#</a></h2><p>Each server has an <code class=\"docutils literal notranslate\"><span class=\"pre\">ID</span></code> that prepends the computer name.</p><p>Each directory for this system will have this ID prepended to the directory name.</p>", "a[href=\"#server-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Server Guide<a class=\"headerlink\" href=\"#server-guide\" title=\"Permalink to this heading\">#</a></h1><p>As a user of MBO servers, you will be given a login to MBO servers, which will give you access to the servers.</p>", "a[href=\"#python\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Python<a class=\"headerlink\" href=\"#python\" title=\"Permalink to this heading\">#</a></h3><p>Python is distributed for each user using <a class=\"reference external\" href=\"https://docs.astral.sh/uv/getting-started/features/\">uv</a> and <a class=\"reference external\" href=\"https://github.com/conda-forge/miniforge\">miniforge3</a>.</p><p>A default <code class=\"docutils literal notranslate\"><span class=\"pre\">Python</span> <span class=\"pre\">3.10</span></code> is added to the system PATH and available by default.</p>", "a[href=\"#connecting-with-rdp\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Connecting with RDP<a class=\"headerlink\" href=\"#connecting-with-rdp\" title=\"Permalink to this heading\">#</a></h2><p>MBO processing servers are accessible via Microsoft Remote Desktop Protocol (RDP).</p><p>There are a few common applications, depending on your operating system:</p>", "a[href=\"#logging-out\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Logging out<a class=\"headerlink\" href=\"#logging-out\" title=\"Permalink to this heading\">#</a></h2><p>To sign out, Windows Menu -&gt; Username -&gt; Sign Out</p>", "a[href=\"#guidelines\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Guidelines<a class=\"headerlink\" href=\"#guidelines\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#id1\"]": "<figure class=\"align-default\" id=\"id1\">\n<img alt=\"../_images/rdp_certif.png\" src=\"../_images/rdp_certif.png\"/>\n<figcaption>\n<p><span class=\"caption-text\">Accept the certificate notification popup to continue connecting to your MBO server.</span><a class=\"headerlink\" href=\"#id1\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#other-software\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Other Software<a class=\"headerlink\" href=\"#other-software\" title=\"Permalink to this heading\">#</a></h3><p>Contact a server administrator to inquire about adding additional software. Please do not install software without consulting an MBO admin.</p>", "a[href=\"#via-windows-app\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">via Windows App<a class=\"headerlink\" href=\"#via-windows-app\" title=\"Permalink to this heading\">#</a></h3><p>You will need the following information to access the servers:</p>", "a[href=\"#software\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h2><h3>Python<a class=\"headerlink\" href=\"#python\" title=\"Permalink to this heading\">#</a></h3><p>Python is distributed for each user using <a class=\"reference external\" href=\"https://docs.astral.sh/uv/getting-started/features/\">uv</a> and <a class=\"reference external\" href=\"https://github.com/conda-forge/miniforge\">miniforge3</a>.</p><p>A default <code class=\"docutils literal notranslate\"><span class=\"pre\">Python</span> <span class=\"pre\">3.10</span></code> is added to the system PATH and available by default.</p>", "a[href=\"#connecting-to-network-servers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Connecting to Network Servers<a class=\"headerlink\" href=\"#connecting-to-network-servers\" title=\"Permalink to this heading\">#</a></h2><p>Computers on the Rockefeller network (with network discoverability turned on) can be accessed via SMB as <code class=\"docutils literal notranslate\"><span class=\"pre\">\\\\server-name</span></code> or <code class=\"docutils literal notranslate\"><span class=\"pre\">\\\\ip-address</span></code>.</p>", "a[href=\"#conda-miniforge3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">conda</span></code> (miniforge3)<a class=\"headerlink\" href=\"#conda-miniforge3\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has its own <code class=\"docutils literal notranslate\"><span class=\"pre\">Miniforge3</span></code> flavored <code class=\"docutils literal notranslate\"><span class=\"pre\">conda</span></code> installation at <code class=\"docutils literal notranslate\"><span class=\"pre\">C:/Users/miniforge3</span></code>.</p><p>This is your environment to install and reinstall as you please.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
